import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    const title = 'Give feedback';
    let votes = {
        "good": 0,
        "neutral": 0,
        "bad": 0
    };

    return (
        <div>
            <Header title={title}/>
            <Buttons/>
            <Table votes={votes}/>
        </div>
    )
}

const Header = (props) => {
    return (
        <h1>{props.title}</h1>
    )
}

const Buttons = () => {
    return (
        <>
            <button>Vote up</button>
            <button>Vote neutral</button>
            <button>Vote down</button>
        </>
    )
}

const Table = (props) => {
    return (
        <table>
            <Tablerow title={props.votes[0]} value={props.votes[0][1]}/>
        </table>
    )
}

const Tablerow = (props) => {
}

ReactDOM.render(<App/>, document.getElementById('root'))
